function App() {
  return (
    <div className="App">
        <Title />
        <Routes>
          <Route exact path='/' element={<News/>}/>
          <Route exact path='/search' element={<Search/>}/>
        </Routes>
        <Pagination />
    </div>
  );
}

export default App;
